    "2011-federal-emergency-management-agency-fema-topographic-lidar-quinnipiac-river-watershed-conndee70",nt"isopen":
    false,nt"url": null,nt"notes": "The Quinnipiac AOI consists of one 443
    square mile area. Ground Control is collected throughout the AOI for use in the
    processing of LiDAR data to ensure data accurately represents the ground surface.
    QA/QC checkpoints, (FVA and CVA - see Ground Control process step for further information)
    also collected throughout the AOI, are used for independent quality checks of the
    processed LiDAR data. LiDAR acquisition products include Pre- and Post- flight reports
    which contain information on the flightlines, equipment parameters, and other pertinant
    acquisition details. The LiDAR product is considered to be point cloud data and
    consists of 1500mx1500m tiles of LAS points which are partially classified such
    that the bare earth points can be calibrated to the ground surface and tested via
    the independent QC to ensure the ground surface is accurately represented. The average
    point spacing of the data set is 0.5m.",nt"license_title": null,nt"extras":
